import { StyleSheet } from 'aphrodite/no-important'

export default StyleSheet.create({
    login: {
        marginTop: '20%',
        marginLeft: '32%'
    },
    log: {
        marginTop: '20%',
        marginLeft: '25%'
    },
    card: {
        marginTop: '2%',
        marginLeft: '2%',
        float: 'left'
    },
    map: {
        float: 'right',
        marginTop: '3%',
        marginRight: '50%'
    },
    item: {
        marginLeft: '4%',
        marginTop: '2%'
    }
})
